  \"2016-03-21T23:17:46.565293\",\n\t\"name\": \"killer-whale-genetic-data-genetic-marker-development-and-applications-for-southern-resident-kil\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In this project, we are using genetic variation
  to infer mating patterns in the southern killer whale community.  In Canada, this
  population was listed as threatened in 1999 and then endangered in 2001 (Baird 2001).
  In the United States, it was listed as endangered in 2005 (http:// www.nwr.noaa.gov/).
  The goals of our study were to 1) use parentage and kinship analysis to infer patterns
  of mating and male reproductive success in the population, 2) evaluate whether any
  of the sampled offspring had fathers from other killer whale populations, and 3)
  estimate the current effective population size of the population and evaluate evidence
  for a recent population bottleneck.nnMicrosatellite, SNP, and mtDNA sequence data
  from southern resident killer whales.\",\n\t\"license_title\": null,\n\t\"extras\":
